import React, { Component } from "react";
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { logoutUser } from "../../actions/authAutentications";
import {Container, Row, Col } from 'react-bootstrap';
import Logo from '../../immagini/logo.png'

class Dashboard extends Component {
  onLogoutClick = e => {
    e.preventDefault();
    this.props.logoutUser();
  };

  render() {
    const { user } = this.props.auth;

    return (
      <div>
       <Container style={{marginTop: '4rem'}}>
         <img src={Logo} width="3rem" color='black'/>
        <Row>
          <Col sm={12}>
            <h1>Benvenuto <b>{user.name}</b>, qui puoi gestire l'amministrazione! <img src={Logo}  color='black'/></h1>
          </Col>
        </Row>
        <Row>
          <Col sm>sm=true</Col>
          <Col sm>sm=true</Col>
          <Col sm>sm=true</Col>
        </Row>
        </Container>
      </div>
    );
  }
}

Dashboard.propTypes = {
  logoutUser: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired
};

const mapStateToProps = state => ({
  auth: state.auth
});

export default connect(
  mapStateToProps,
  { logoutUser }
)(Dashboard);
